description:
Ambientada en un mundo futurista donde los humanos viven aislados en interaccion con robots, un policia (Willis) se vera forzado a abandonar su hogar por primera vez en anios para investigar unos asesinatos. Bruce Willis, Ving Rhames, Rosamund Pike, Radha Mitchell, Michael Cudlitz, Boris Kodjoe, Valerie Azlynn, Jack Noseworthy, Rachel Sterling, Stream, Jordan Belfi, James Francis Ginty, Michael O Toole.
